import React from 'react';
import { Link } from 'react-router-dom';

const Button = ({ to, children }) => {
  return (
    <Link to={to} className="mt-4 bg-white px-2 py-0 text-black shadow-lg flex items-center justify-center" style={{ backgroundColor: 'rgba(255, 255, 255, 0.85)', color: 'rgba(0, 0, 0, 0.85)', borderRadius: '10px', boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.5)', fontSize: 'clamp(1.5rem, 4vw, 10rem)', padding: '0.5rem 1.5rem' }}>
      {children}
    </Link>
  );
};

export default Button;
